export const isDemoProvider = ({
  providerKey,
  providerModel,
  providerUrl,
}: {
  providerKey: string;
  providerModel: string;
  providerUrl: string;
}) => {
  return (
    providerKey === "sk_demo" &&
    providerModel === "claude-3-5-sonnet-latest" &&
    providerUrl === "https://api.anthropic.com/v1/messages"
  );
};

const imageBase64 = ``;

export const getDemoProvider = ({
  input,
  providerKey,
  providerModel,
  providerUrl,
}: {
  input: string;
  providerKey: string;
  providerModel: string;
  providerUrl: string;
}) => {
  if (
    isDemoProvider({ providerKey, providerModel, providerUrl }) &&
    process.env.ANTHROPIC_DEMO_KEY
  ) {
    console.log(input);
    if (input.trim().startsWith(`/9j/4Q/`) && input.trim() === imageBase64) {
      return {
        providerKey: process.env.ANTHROPIC_DEMO_KEY,
        providerModel,
        providerUrl,
      };
    }

    if (
      input.trim() ===
      "A particularly severe crisis in 1907 led Congress to enact the Federal Reserve Act in 1913"
    ) {
      return {
        providerKey: process.env.ANTHROPIC_DEMO_KEY,
        providerModel,
        providerUrl,
      };
    }

    throw new Error(
      "Invalid input. Must be 'A particularly severe crisis in 1907 led Congress to enact the Federal Reserve Act in 1913' or the base64 output of 'https://public.l1m.io/menu.jpg'"
    );
  }
};
